API.html.body:
Autodata API
Init
autoData.init({
    // settings
});

Settings
{
    attributePrefix: 'data-',
    tms: {
      name: 'gtm',
      parser: function(type, data) {}, // Optional
      sender: function(parsedTag) {}, // Optional
      enhancer: function (parsedTag) {}, // Optional
    },
    plugins: {

    }
}

name
The tms name that you want to use
parser
This parsing function will be called whenever a tag is triggered, this is your opportunity
to enhance default tms logic or provide your own one
enhancer
This function allows you to add custom data on the already parsed tag. This could have been done
by the parsing function but it is done this way in order to seperate the role of each function.
autoData.sendPageView
Usage
autoData.sendPageView({
    page: '', // optional
    title: '', // optional,
});

Result
{
    "event": "pageview",
    "page": "",
    "title": ""
}

autoData.sendVirtualPageView
Usage
autoData.sendVirtualPageView({
    page: '', // optional
    title: '', // optional,
});

Result
{
    "event": "virtualpageview",
    "page": "",
    "title": ""
}

autoData.sendEvent
Usage
autoData.sendEvent({
    foo: true,
    bar: false,
    baz: true
});

Result
{
    "foo": true,
    "bar": false,
    "baz": true
}

plugins/EVENT-TRACKER.html.body:
Event plugin
This plugin is aimed to tag automatically event data.
As soon as the user with click on the page, the eventTracker will see if the element
matches the attributes rules and then send the tag automatically.
Initialization ans usage
autoData.init({
  plugins: {
    eventTracker: {
      // your configuration here
    }
  }
});



Default configuration
{
  attributePrefix: 'data-event-',
  trigger: 'obj',
  attributes: ['act', 'desc', 'val']
}

attributePrefix (optional)
Attribute prefix used for DOM selection
trigger (optional)
Attribute used for DOM selection by the plugin
attributes (optional)
Set of attributes that should be collected on the trigger element in order
to build the tag

plugins/MEDIA-QUERY-TRACKER.html.body:
Media query plugin
This plugin is aimed to tag the viewport changes on your website.
Initialization ans usage
autoData.init({
  plugins: {
    mediaQueryTracker: {
      // your configuration here
    }
  }
});

Default configuration
{
  mediaQueryDefinitions: false,
  mediaQueryChangeTemplate: this.changeTemplate,
  mediaQueryChangeTimeout: 1000
}

mediaQueryDefinitions (mandatory)
Set of media-queries that should be spied by the browser in order to
tag it when a change occurs.
The configuration must match the following example :
{
  mediaQueryDefinitions: [
    {
      name: 'Breakpoint',
      dimensionIndex: 1,
      items: [
        {name: 'sm', media: 'all'},
        {name: 'md', media: '(min-width: 30em)'},
        {name: 'lg', media: '(min-width: 48em)'}
      ]
    }
  ]
}

In this case, a tag with the name of "Breakpoing" will be dispatched whenever
one of the given mediaQueries in items is active
mediaQueryChangeTemplate (optional)
Let you define the template for value of the changes, by default it is as follow
oldValue + ' => ' + newValue

mediaQueryChangeTimeout (optional)
NOTE This value is in milliseconds
The tag will be debounced to this value in order to prevent performance issues
It is recommended to set a value around 1 second.

plugins/OUTBOUND-FORM-TRACKER.html.body:
Outbound form plugin
This plugin is aimed to send a tag whenever a form is posted
to a outbound link.
Initialization ans usage
autoData.init({
  plugins: {
    outboundFormTracker: {
      // your configuration here
    }
  }
});

Default configuration
{
  shouldTrackOutboundForm: this.shouldTrackOutboundForm
}

shouldTrackOutboundForm (optional)
This function let you manage manually if you wish to treat the current form
as an outbound link.

